import React from 'react';
import { Box, Text, VStack, Flex, Button } from '@chakra-ui/react';
import { FaFileDownload } from "react-icons/fa";

const DownloadBox = () => {
  return (
    <Box position="relative">
      <Flex
        direction="column"
        w="100%"
        bg="#f2f2f3"
        borderRadius="20px"
        border="1px solid black"
        boxShadow="0 4px 0 0 black"
        position="relative"
        overflow="hidden"
        p={6}
        opacity={0.5}
        cursor="not-allowed"
      >
        <VStack spacing={4} align="center" justify="center" height="100%">
          <Box as={FaFileDownload} size="48px" color="black" />
          <Text fontSize="20px" fontWeight="700" color="black" textAlign="center">
            Download exam questions
          </Text>
          <Text fontSize="16px" fontWeight="500" color="black" textAlign="center">
            PDF
          </Text>
        </VStack>
      </Flex>

      <Button
        position="absolute"
        top="-10px"
        right="-10px"
        transform="rotate(45deg)"
        bg="linear-gradient(45deg, #ffaa40, #9c40ff, #ffaa40)"
        color="white"
        fontWeight="bold"
        borderRadius="full"
        px={4}
        py={2}
        border="1px solid black"
        boxShadow="0 2px 0 0 black"
        _hover={{
          bg: "linear-gradient(45deg, #ff9020, #7c20ff, #ff9020)",
        }}
        _active={{
          boxShadow: "none",
          transform: "rotate(45deg) translateY(2px)",
        }}
      >
        <Text
          as="span"
          bgGradient="linear(to-r, #ffaa40, #9c40ff, #ffaa40)"
          bgClip="text"
          fontSize="sm"
        >
          Go Premium!
        </Text>
      </Button>
    </Box>
  );
};

export default DownloadBox;
